const WebFormList = ({ webFields, removeFromList }) => {
  const list = webFields.map(
    ({ _id, fieldName, fieldInForm, fieldFormVisible, fieldOptions, fieldType }) =>
      fieldInForm ? (
        <li key={_id}>
          {fieldName}
          {fieldFormVisible
            ? `-> visible in form`
            : fieldType === "select"
                ? fieldOptions.some(e => e.preselected)
                    ? `-> hidden in form with ${e.value} as preselected!`
                    : null
                : null
            }

          <button id={fieldName} onClick={removeFromList}>
            X
          </button>
        </li>
      ) : null
  );

  return <ul>{list}</ul>;
};

export default WebFormList;
